import logo from "./logo.svg";
import "./App.css";
import FormImport from "./view/FormImport";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  BrowserRouter,
  Routes,
} from "react-router-dom";

function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<FormImport />}></Route>
      </Routes>
    </>
  );
}

export default App;
